    false,nt"url": null,nt"notes": "This narrative report details the conditions
    and management of Stillwater Wildlife Management Area from September through December
    of 1949.  The report begins with general information about weather and water conditions
    on the refuge.  The second section of the report describes wildlife on the refuge
    and includes migratory birds, upland game birds, fur animals, predaceous birds,
    and fish.  The report then covers the refugeu2019s development and maintenance projects
    such as canal construction, drain construction, and road construction.  The fourth
    section of the report includes information about economic use of the refuge and
    includes fur harvesting.  The last two sections of the report describe field investigations
    and research and public relations; a list of refuge visitors is given and hunting
    conditions are summarized.  Finally, N-R forms and photographs are provided.",nt"owner_org":
